<html lang="zh-CN">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1" />
<title>三层地球（Canvas）</title>
<style>
  :root {
    --size: 768px; /* 目标尺寸，可按需修改 */
  }
  body {
    margin: 0;
    display: grid;
    place-items: center;
    min-height: 100vh;
    background: #0b1020;
    color: #fff;
    font-family: ui-sans-serif, system-ui, -apple-system, Segoe UI, Roboto, Noto Sans, Helvetica, Arial;
  }
  .stack {
    position: relative;
    width: var(--size);
    height: var(--size);
    filter: drop-shadow(0 8px 24px rgba(0,0,0,.35));
  }
  canvas { position: absolute; inset: 0; width: 100%; height: 100%; }
  .legend { margin-top: 16px; opacity: .9; font-size: 14px; }
</style>
</head>

  function setupCanvas(canvas) {
    canvas.width = Math.round(SIZE * DPR);
    canvas.height = Math.round(SIZE * DPR);
    const ctx = canvas.getContext('2d');
    ctx.setTransform(DPR, 0, 0, DPR, 0, 0);
    return ctx;
  }

  function drawLayer(canvasId, img) {
    const canvas = document.getElementById(canvasId);
    const ctx = setupCanvas(canvas);
    ctx.clearRect(0, 0, SIZE, SIZE);
    ctx.imageSmoothingEnabled = true;
    ctx.imageSmoothingQuality = 'high';
    ctx.drawImage(img, 0, 0, SIZE, SIZE);
  }

  Promise.all(canvases.map(info => new Promise((resolve) => {
    const im = new Image();
    im.onload = () => resolve({ id: info.id, image: im });
    im.src = info.src;
  }))).then(layers => {
    layers.forEach(({id, image}) => drawLayer(id, image));
  });

  const resize = () => {
    const minSide = Math.min(window.innerWidth, window.innerHeight) * 0.9;
    const size = Math.min(minSide, SIZE);
    stack.style.setProperty('--size', size + 'px');
  };
  window.addEventListener('resize', resize);
  resize();
})();
</script>
